import React from "react";
import './explore.css';

const Explore = () => {
    return (
        <>
            <section className="home">
                <div className="home-container">
                    <div className="row">
                        <h1>Home Decor</h1>
                        <h1>Made Easy</h1>
                        <div className="explore_button">
                                <a>
                                    Explore
                                </a>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
}

export default Explore;
